let winners = [];
let rollingInterval;
let currentParticipantIndex = 0;
let maxSelected=0;
 const namesContainer = document.getElementById('names');
        const startButton = document.getElementById('startButton');
        const stopButton = document.getElementById('stopButton');

        const radius = 110; // Reduced radius for tighter circle
        const visibleCount = 10; // Limit to 10 visible names at a time
        const angleStep = 360 / visibleCount; // Fixed step for visible names
        let currentRotation = 0;
        let animationFrame;

        function getRandomNames() {
            const shuffled = [...participants].sort(() => Math.random() - 0.5);
            return shuffled.slice(0, visibleCount);
        }

        function createNames() {
            namesContainer.innerHTML = '';
            const randomNames = getRandomNames();

            randomNames.forEach((person, i) => {
                const nameDiv = document.createElement('div');
                nameDiv.classList.add('name');
                nameDiv.textContent = person.name+' '+person.family+' - '+person.personNumber;
                const angle = i * angleStep;
                nameDiv.style.transform = `translate(-50%, -50%) rotateX(${angle}deg) translateZ(${radius}px)`;
                namesContainer.appendChild(nameDiv);
            });
        }

        function updateRotation() {
            currentRotation = (currentRotation - 12) % 360; // Adjust speed
            const nameElements = document.querySelectorAll('.name');

            nameElements.forEach((el, i) => {
                const angle = (i * angleStep + currentRotation) % 360;
                el.style.transform = `translate(-50%, -50%) rotateX(${angle}deg) translateZ(${radius}px)`;

                // Hide elements on the back
                const normalizedAngle = (angle + 360) % 360;
                if (normalizedAngle > 90 && normalizedAngle < 270) {
                    el.style.opacity = '0';
                } else {
                    el.style.opacity = '1';
                }
            });

            if (Math.abs(currentRotation % 360) < 0.5) {
                createNames(); // Refresh names at full rotation
            }

            animationFrame = requestAnimationFrame(updateRotation);
        }

        

        
function startRotation() {
	
	document.getElementById('backgroundAudio').play();
		addWinnerInterval = setInterval(() => {
        selectWinner();
    }, 4000); 
            if (!animationFrame) {
				
                updateRotation();
            }
			 document.getElementById('startButton').disabled = true;
    document.getElementById('stopButton').disabled = false;
        }

function stopRotation() {
	clearInterval(addWinnerInterval);
    cancelAnimationFrame(animationFrame);
    animationFrame = null;
	document.getElementById('stopButton').disabled = true;
    document.getElementById('startButton').disabled = false;
	document.getElementById('backgroundAudio').pause();
 }
function selectWinner(){
	
    if (winners.length<maxSelected){
		let indexSelected = Math.floor(Math.random() * (participants.length -2)) + 1;
        const win = participants[indexSelected];
        if (winners.includes(win.name+' '+ win.family+' - '+win.personNumber)) {
            return;
        }
        else{
            winners.unshift(win.name+' '+ win.family+' - '+win.personNumber);
    updateWinnersList();
        }
    }
    else{
       stopRotation();
    }
}

function saveWinnersToLocalStorage() {
    localStorage.setItem('winners', JSON.stringify(winners));
}

function loadWinnersFromLocalStorage() {
    const storedWinners = localStorage.getItem('winners');
    if (storedWinners) {
        winners = JSON.parse(storedWinners);
        updateWinnersList();
    }
}

function updateWinnersList() {
    const winnersList = document.getElementById('winnersList');
    winnersList.innerHTML = "";
    winners.forEach((winner, index) => {
        const listItem = document.createElement('li');
        listItem.textContent = `${index + 1}. ${winner}`;
        winnersList.appendChild(listItem);
    });
    participants.splice(currentParticipantIndex, 1);

    if (participants.length === 0) {
        document.getElementById('startButton').disabled = true;
        document.getElementById('stopButton').disabled = true;
    }

    saveWinnersToLocalStorage();
}

function clearWinners() {
    if (confirm("آیا مطمئن هستید که می‌خواهید لیست برندگان را خالی کنید؟")) {
        winners = [];
        updateWinnersList(); 
        localStorage.removeItem('winners'); 
        alert("لیست برندگان با موفقیت خالی شد!");
    }
}

function printWinners() {
    const printWindow = window.open('', '_blank');
    const winnersHtml = `
        <html>
        <head>
            <title>لیست برندگان</title>
            <style>
                body {
                    font-family: Arial, sans-serif;
                    text-align: center;
                    direction: rtl;
                }
                h1 {
                    color: #333;
                }
                ul {
                    list-style: none;
                    padding: 0;
                }
                li {
                    font-size: 18px;
                    margin: 5px 0;
                }
            </style>
        </head>
        <body>
            <h1>لیست برندگان</h1>
            <ul>
                ${winners.map((winner, index) => `<li>${index + 1}. ${winner}</li>`).join('')}
            </ul>
        </body>
        </html>
    `;
    printWindow.document.write(winnersHtml);
    printWindow.document.close();
    printWindow.print();
}
